import React, { useContext } from 'react';
import { Container, Typography, Button, Paper, Box } from '@mui/material';
import { useLocation, useNavigate } from 'react-router-dom';
import { TokenContext } from '../context/TokenContext';

const TokenSuccess = () => {
  const navigate = useNavigate();
  const { state } = useLocation();
  const { getRecentToken } = useContext(TokenContext);

  // Get the most recent token details
  const token = getRecentToken(state?.gender);

  return (
    <Container maxWidth="sm" sx={{ mt: 6 }}>
      <Paper elevation={3} sx={{ p: 4, borderRadius: 3, textAlign: 'center' }}>
        <Typography variant="h5" color="primary" gutterBottom>
          Your Token Details
        </Typography>

        <Box sx={{ 
          my: 4,
          p: 3,
          borderRadius: 2,
          bgcolor: 'rgba(51, 18, 107, 0.05)'
        }}>
          <Typography variant="h1" color="secondary" sx={{ 
            fontWeight: 'bold',
            mb: 2,
            background: 'linear-gradient(45deg, #33126B 30%, #FF0A91 90%)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent'
          }}>
            {token?.tokenId || `M${state?.tokenNumber || '1'}`}
          </Typography>

          <Typography variant="subtitle1" color="text.secondary" gutterBottom>
            {token?.gender === 'male' ? '♂ Male' : token?.gender === 'female' ? '♀ Female' : ''} • {token?.service || 'Service'}
          </Typography>

          <Typography variant="body1" color="text.primary" sx={{ mt: 2 }}>
            {token?.name || 'Customer'}
          </Typography>

          <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
            Mobile: {token?.mobile || 'N/A'}
          </Typography>
        </Box>

        <Typography variant="body2" color="text.secondary" sx={{ mb: 3 }}>
          Please wait for your number to be called.
        </Typography>

        <Button 
          variant="contained" 
          color="primary"
          onClick={() => navigate('/')}
          sx={{ mt: 2, px: 4 }}
        >
          Back to Home
        </Button>
      </Paper>
    </Container>
  );
};

export default TokenSuccess;
